import React from "react";
import Shifter from "./Shifter";

const Items = (props) => {
//   if (props.data.length === 0) {
//     return <p></p>;
//   }

  return (
    <ul>
      {props.data.map((person) => (
        <Shifter 
        time={person.key}
        name={person.value}/>
      ))}
      ;
    </ul>
  );
};

export default Items;
